function BlackLineTitle(props) {
    let addClass = "";
    if (props.Light === true) {
        addClass = "LightGreenFontShade LightLine";
    }
    return(
        <h2 className={addClass+" LineTextLine CursiveFont MdFont"}>{props.Title}</h2>
    );
}

export default BlackLineTitle;
